import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { createTheme } from '@mui/material/styles';
import Box from '@mui/material/Box';

// Layout Components
import Header from './components/Layout/Header';
import Sidebar from './components/Layout/Sidebar';
import Footer from './components/Layout/Footer';

// Main Components
import Dashboard from './components/Dashboard';
import TaskManager from './components/TaskManager';
import HabitTracker from './components/HabitTracker';
import FinanceHub from './components/FinanceHub';
import HealthTracker from './components/HealthTracker';
import GoalManager from './components/GoalManager';
import RelationshipManager from './components/RelationshipManager';
import HomeLifestyle from './components/HomeLifestyle';
import KnowledgeBase from './components/KnowledgeBase';
import Analytics from './components/Analytics';

// Auth Components
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import Profile from './components/Auth/Profile';

// Styles
import './App.css';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
    background: {
      default: '#f5f5f5',
    },
  },
  typography: {
    fontFamily: 'Roboto, Arial, sans-serif',
  },
});

function App() {
  const [sidebarOpen, setSidebarOpen] = React.useState(false);
  const [user, setUser] = React.useState(null);

  React.useEffect(() => {
    // Check for stored user session
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      setUser(JSON.parse(storedUser));
    }
  }, []);

  const handleSidebarToggle = () => {
    setSidebarOpen(!sidebarOpen);
  };

  if (!user) {
    return (
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <Router>
          <Routes>
            <Route path="/login" element={<Login setUser={setUser} />} />
            <Route path="/register" element={<Register setUser={setUser} />} />
            <Route path="/*" element={<Login setUser={setUser} />} />
          </Routes>
        </Router>
      </ThemeProvider>
    );
  }

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
          <Header onMenuClick={handleSidebarToggle} user={user} setUser={setUser} />
          
          <Box sx={{ display: 'flex', flex: 1 }}>
            <Sidebar open={sidebarOpen} onClose={() => setSidebarOpen(false)} />
            
            <Box component="main" sx={{ flex: 1, p: 3, mt: 8 }}>
              <Routes>
                <Route path="/" element={<Dashboard />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/tasks" element={<TaskManager />} />
                <Route path="/habits" element={<HabitTracker />} />
                <Route path="/finance" element={<FinanceHub />} />
                <Route path="/health" element={<HealthTracker />} />
                <Route path="/goals" element={<GoalManager />} />
                <Route path="/relationships" element={<RelationshipManager />} />
                <Route path="/home" element={<HomeLifestyle />} />
                <Route path="/knowledge" element={<KnowledgeBase />} />
                <Route path="/analytics" element={<Analytics />} />
                <Route path="/profile" element={<Profile user={user} setUser={setUser} />} />
              </Routes>
            </Box>
          </Box>
          
          <Footer />
        </Box>
      </Router>
    </ThemeProvider>
  );
}

export default App;
